import React from 'react';
import { Table } from 'react-bootstrap';

function ViewProtectionScheduleTable({ protection_schedule }) {
  // Helper function to convert date format
  const formatDate = (dateString) => {
    const day = dateString.slice(0, 2);
    const month = dateString.slice(2, 4);
    const year = dateString.slice(4, 8);
    return `${day}.${month}.${year}`;
  };

  // Group the schedule by group name
  const groupedByGroupName = protection_schedule.reduce((acc, item) => {
    const groupName = item.group.name;
    if (!acc[groupName]) {
      acc[groupName] = [];
    }
    acc[groupName].push(item);
    return acc;
  }, {});

  return (
    <>
      <h4 className="mb-4 text-center">График защит ВКР</h4>
      {Object.keys(groupedByGroupName).map((groupName, groupIdx) => {
        const groupItems = groupedByGroupName[groupName];
        const datesSet = new Set(groupItems.map(item => item.date));

        // If there is only one date for the group, display all entries in one table
        if (datesSet.size === 1) {
          const date = formatDate(groupItems[0].date);

          return (
            <div key={groupIdx} style={{ marginBottom: '20px' }}>
              <h5>{groupName}</h5>
              <Table bordered style={{ width: '100%' }}>
                <thead>
                  <tr>
                    <th>ПП</th>
                    <th>Дата</th>
                    <th>Время</th>
                    <th>Аудитория</th>
                  </tr>
                </thead>
                <tbody>
                  {groupItems.map((item, idx) => (
                    <tr key={item.id}>
                      <td>{idx + 1}</td>
                      <td>{date}</td>
                      <td>9:00</td>
                      <td>{item.audience_number}</td>
                    </tr>
                  ))}
                </tbody>
              </Table>
            </div>
          );
        }

        // If there are multiple dates for the group, display each date in a separate table
        return (
          <div key={groupIdx} style={{ marginBottom: '20px' }}>
            <h5>{groupName}</h5>
            {groupItems.map((item, itemIdx) => {
              const date = formatDate(item.date);

              return (
                <Table bordered style={{ width: '100%', marginBottom: '10px' }} key={itemIdx}>
                  <thead>
                    <tr>
                      <th>ПП</th>
                      <th>Дата</th>
                      <th>Время</th>
                      <th>Аудитория</th>
                    </tr>
                  </thead>
                  <tbody>
                    <tr>
                      <td>{itemIdx + 1}</td>
                      <td>{date}</td>
                      <td>9:00</td>
                      <td>{item.audience_number}</td>
                    </tr>
                  </tbody>
                </Table>
              );
            })}
          </div>
        );
      })}
    </>
  );
}

export default ViewProtectionScheduleTable;
